import { useRef } from "react";
import { colors } from "../../locales/colors";
import { CartImg } from "../../locales/images/cart";
import { InfoImg } from "../../locales/images/info";
import { ButtonPhoto } from "../../style";

export const FoodPhotoButton = ({ icon, color, onClick }: any) => {
  function chooseIcon() {
    switch (icon) {
      case "cart":
        return <CartImg color={color} />;
      case "info":
        return <InfoImg color={color} />;
      case "plus":
        return <InfoImg color={color} />;
      case "minus":
        return <InfoImg color={color} />;
      default:
        return null;
    }
  }
  return <ButtonPhoto onClick={onClick}>{chooseIcon()}</ButtonPhoto>;
};
